import React from 'react'
import '../css/Recipe.css'

const Recipe = ({recipe, id}) => {
    const recipeImg = `https://spoonacular.com/recipeImages/${id}-480x360.jpg`



    return (
        <div className="recipe">
            <img src={recipeImg} alt='' />
            <h3>{recipe.title}</h3>

        </div>
    )
}

export default Recipe
